import React from 'react';
import {makeStyles} from "@material-ui/core"
const useStyles=makeStyles({
    root:{
        display:"flex",
        flexDirection:"column",
        justifyContent:"center",
        alignItems:"center",
        width:"300px",
        height:"350px",
        background:"blue",
        borderRadius:"10px"
    }
})
const Index = () => {
    const classes=useStyles()
    return (
        <div className={classes.root}>
        </div>
    );
}

export default Index;
